import { createStore } from "redux";
import { combineReducers } from "redux";
import CommonReducer from "./CommonReducer";
import personalInfoReducer from "../Components/PersonalInfo/personalInfoReducer";
import workExperienceReducer from "./workExperienceReducer";
import keySkillsReducer from "../Components/KeySkills/keySkillsReducer";
import educationDetailsReducer from "./educationDetailsReducer";

export const store = createStore(
  combineReducers({
    CommonReducer,
    personalInfoReducer,
    workExperienceReducer,
    keySkillsReducer,
    educationDetailsReducer,
  })
);
